id = "PAV081"
question = "Hur stor andel av den globala stålproduktionen baseras på stålskrot idag?"
answer = "Skrotbaserat stål har mycket mindre miljöpåverkan än malmbaserat stål, därför är det önskvärt att andelen skrotbaserat stål ökar. Men eftersom världens behov av stål växer så fort som det gör just nu, räcker stålskrotet bara till 30 procent av stålproduktionen globalt. Resten måste tillverkas av järnmalm"
